import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import { 
  Settings, 
  BarChart3, 
  Users, 
  Database, 
  Upload, 
  Download, 
  RefreshCw, 
  AlertTriangle,
  CheckCircle,
  Clock,
  TrendingUp,
  Activity,
  FileText,
  Brain
} from 'lucide-react';
import { 
  LineChart, 
  Line, 
  XAxis, 
  YAxis, 
  CartesianGrid, 
  Tooltip, 
  ResponsiveContainer, 
  BarChart, 
  Bar,
  PieChart,
} from 'recharts';
import './AdminPanel.css';

const AdminPanel = () => {
  const [activeTab, setActiveTab] = useState('overview');
  const [simulationLogs, setSimulationLogs] = useState([]);
  const [modelPerformance, setModelPerformance] = useState({});
  const [systemStats, setSystemStats] = useState({});

  useEffect(() => {
    // Load admin data
    loadAdminData();
  }, []);

  const loadAdminData = () => {
    // Mock data for admin panel
    const mockLogs = [
      {
        id: 1,
        timestamp: '2024-01-15 14:30:25',
        user: 'user_123',
        track: 'Silverstone',
        mode: 'Eco',
        duration: 45.2,
        status: 'completed',
        aiLapTime: 83.456,
        humanLapTime: 87.234,
        energySaved: 0.4
      },
      {
        id: 2,
        timestamp: '2024-01-15 14:25:10',
        user: 'user_456',
        track: 'Monza',
        mode: 'Balanced',
        duration: 52.1,
        status: 'completed',
        aiLapTime: 89.123,
        humanLapTime: 92.567,
        energySaved: 0.3
      },
      {
        id: 3,
        timestamp: '2024-01-15 14:20:45',
        user: 'user_789',
        track: 'Yas Marina',
        mode: 'Aggressive',
        duration: 38.7,
        status: 'failed',
        aiLapTime: null,
        humanLapTime: null,
        energySaved: null
      }
    ];

    const mockModelPerformance = {
      ppo: { accuracy: 94.2, efficiency: 92.5, consistency: 96.1 },
      sac: { accuracy: 96.8, efficiency: 94.7, consistency: 93.8 },
      td3: { accuracy: 95.5, efficiency: 93.2, consistency: 95.4 }
    };

    const mockSystemStats = {
      totalSimulations: 1247,
      activeUsers: 89,
      averageSessionTime: 42.3,
      systemUptime: 99.8,
      dataProcessed: 2.4 // GB
    };

    setSimulationLogs(mockLogs);
    setModelPerformance(mockModelPerformance);
    setSystemStats(mockSystemStats);
  };

  const handleRetrainModel = (modelType) => {
    // Mock model retraining
    alert(`Starting retraining for ${modelType.toUpperCase()} model...`);
  };

  const handleUploadDataset = () => {
    // Mock dataset upload
    alert('Dataset upload functionality would be implemented here');
  };

  const handleDownloadLogs = () => {
    // Mock log download
    const logData = JSON.stringify(simulationLogs, null, 2);
    const blob = new Blob([logData], { type: 'application/json' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = 'simulation-logs.json';
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
    URL.revokeObjectURL(url);
  };

  const performanceData = [
    { name: 'PPO', accuracy: 94.2, efficiency: 92.5, consistency: 96.1 },
    { name: 'SAC', accuracy: 96.8, efficiency: 94.7, consistency: 93.8 },
    { name: 'TD3', accuracy: 95.5, efficiency: 93.2, consistency: 95.4 }
  ];

  const usageData = [
    { time: '00:00', simulations: 12 },
    { time: '04:00', simulations: 8 },
    { time: '08:00', simulations: 45 },
    { time: '12:00', simulations: 78 },
    { time: '16:00', simulations: 92 },
    { time: '20:00', simulations: 67 }
  ];


  const tabs = [
    { id: 'overview', label: 'Overview', icon: BarChart3 },
    { id: 'simulations', label: 'Simulations', icon: Activity },
    { id: 'models', label: 'Models', icon: Brain },
    { id: 'system', label: 'System', icon: Settings }
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: {
      opacity: 1,
      y: 0,
      transition: {
        duration: 0.5,
        ease: "easeOut"
      }
    }
  };

  return (
    <div className="admin-panel">
      <div className="container">
        <motion.div 
          className="admin-header"
          variants={containerVariants}
          initial="hidden"
          animate="visible"
        >
          <motion.h1 className="admin-title" variants={itemVariants}>
            Admin Panel
          </motion.h1>
          
          <motion.p className="admin-description" variants={itemVariants}>
            Monitor simulations, manage AI models, and analyze system performance
          </motion.p>
        </motion.div>

        {/* Tab Navigation */}
        <motion.div 
          className="admin-tabs"
          variants={containerVariants}
          initial="hidden"
          animate="visible"
        >
          {tabs.map((tab) => {
            const Icon = tab.icon;
            return (
              <motion.button
                key={tab.id}
                className={`admin-tab ${activeTab === tab.id ? 'active' : ''}`}
                onClick={() => setActiveTab(tab.id)}
                variants={itemVariants}
                whileHover={{ scale: 1.02 }}
                whileTap={{ scale: 0.98 }}
              >
                <Icon size={20} />
                {tab.label}
              </motion.button>
            );
          })}
        </motion.div>

        {/* Tab Content */}
        <motion.div 
          className="admin-content"
          key={activeTab}
          initial={{ opacity: 0, x: 20 }}
          animate={{ opacity: 1, x: 0 }}
          transition={{ duration: 0.5 }}
        >
          {activeTab === 'overview' && (
            <div className="overview-content">
              <div className="stats-grid">
                <div className="stat-card">
                  <div className="stat-icon">
                    <Activity size={24} />
                  </div>
                  <div className="stat-content">
                    <div className="stat-value">{systemStats.totalSimulations}</div>
                    <div className="stat-label">Total Simulations</div>
                  </div>
                </div>
                
                <div className="stat-card">
                  <div className="stat-icon">
                    <Users size={24} />
                  </div>
                  <div className="stat-content">
                    <div className="stat-value">{systemStats.activeUsers}</div>
                    <div className="stat-label">Active Users</div>
                  </div>
                </div>
                
                <div className="stat-card">
                  <div className="stat-icon">
                    <Clock size={24} />
                  </div>
                  <div className="stat-content">
                    <div className="stat-value">{systemStats.averageSessionTime}m</div>
                    <div className="stat-label">Avg Session Time</div>
                  </div>
                </div>
                
                <div className="stat-card">
                  <div className="stat-icon">
                    <TrendingUp size={24} />
                  </div>
                  <div className="stat-content">
                    <div className="stat-value">{systemStats.systemUptime}%</div>
                    <div className="stat-label">System Uptime</div>
                  </div>
                </div>
              </div>

              <div className="charts-grid">
                <div className="chart-card">
                  <h3>Simulation Usage</h3>
                  <ResponsiveContainer width="100%" height={200}>
                    <LineChart data={usageData}>
                      <CartesianGrid strokeDasharray="3 3" stroke="rgba(255, 255, 255, 0.1)" />
                      <XAxis dataKey="time" stroke="rgba(255, 255, 255, 0.6)" />
                      <YAxis stroke="rgba(255, 255, 255, 0.6)" />
                      <Tooltip 
                        contentStyle={{ 
                          backgroundColor: 'rgba(0, 0, 0, 0.8)', 
                          border: '1px solid rgba(255, 255, 255, 0.2)',
                          borderRadius: '8px'
                        }}
                      />
                      <Line type="monotone" dataKey="simulations" stroke="#00ff88" strokeWidth={2} />
                    </LineChart>
                  </ResponsiveContainer>
                </div>

                <div className="chart-card">
                  <h3>Track Usage Distribution</h3>
                  <ResponsiveContainer width="100%" height={200}>
                    <PieChart>
                      <Tooltip 
                        contentStyle={{ 
                          backgroundColor: 'rgba(0, 0, 0, 0.8)', 
                          border: '1px solid rgba(255, 255, 255, 0.2)',
                          borderRadius: '8px'
                        }}
                      />
                      <Bar dataKey="value" fill="#8884d8" />
                    </PieChart>
                  </ResponsiveContainer>
                </div>
              </div>
            </div>
          )}

          {activeTab === 'simulations' && (
            <div className="simulations-content">
              <div className="simulations-header">
                <h3>Simulation Logs</h3>
                <div className="simulations-actions">
                  <button className="action-btn" onClick={handleDownloadLogs}>
                    <Download size={16} />
                    Download Logs
                  </button>
                  <button className="action-btn" onClick={loadAdminData}>
                    <RefreshCw size={16} />
                    Refresh
                  </button>
                </div>
              </div>
              
              <div className="logs-table">
                <div className="table-header">
                  <div>Timestamp</div>
                  <div>User</div>
                  <div>Track</div>
                  <div>Mode</div>
                  <div>Duration</div>
                  <div>Status</div>
                  <div>AI Time</div>
                  <div>Human Time</div>
                  <div>Energy Saved</div>
                </div>
                
                {simulationLogs.map((log) => (
                  <div key={log.id} className="table-row">
                    <div>{log.timestamp}</div>
                    <div>{log.user}</div>
                    <div>{log.track}</div>
                    <div>{log.mode}</div>
                    <div>{log.duration}s</div>
                    <div>
                      <span className={`status ${log.status}`}>
                        {log.status === 'completed' ? <CheckCircle size={16} /> : <AlertTriangle size={16} />}
                        {log.status}
                      </span>
                    </div>
                    <div>{log.aiLapTime ? `${log.aiLapTime}s` : '-'}</div>
                    <div>{log.humanLapTime ? `${log.humanLapTime}s` : '-'}</div>
                    <div>{log.energySaved ? `${log.energySaved} kWh` : '-'}</div>
                  </div>
                ))}
              </div>
            </div>
          )}

          {activeTab === 'models' && (
            <div className="models-content">
              <div className="models-header">
                <h3>AI Model Performance</h3>
                <button className="action-btn" onClick={handleUploadDataset}>
                  <Upload size={16} />
                  Upload Dataset
                </button>
              </div>
              
              <div className="models-grid">
                {Object.entries(modelPerformance).map(([model, metrics]) => (
                  <div key={model} className="model-card">
                    <div className="model-header">
                      <h4>{model.toUpperCase()}</h4>
                      <button 
                        className="retrain-btn"
                        onClick={() => handleRetrainModel(model)}
                      >
                        <RefreshCw size={16} />
                        Retrain
                      </button>
                    </div>
                    
                    <div className="model-metrics">
                      <div className="metric">
                        <span>Accuracy</span>
                        <span>{metrics.accuracy}%</span>
                      </div>
                      <div className="metric">
                        <span>Efficiency</span>
                        <span>{metrics.efficiency}%</span>
                      </div>
                      <div className="metric">
                        <span>Consistency</span>
                        <span>{metrics.consistency}%</span>
                      </div>
                    </div>
                  </div>
                ))}
              </div>

              <div className="performance-chart">
                <h3>Model Comparison</h3>
                <ResponsiveContainer width="100%" height={300}>
                  <BarChart data={performanceData}>
                    <CartesianGrid strokeDasharray="3 3" stroke="rgba(255, 255, 255, 0.1)" />
                    <XAxis dataKey="name" stroke="rgba(255, 255, 255, 0.6)" />
                    <YAxis stroke="rgba(255, 255, 255, 0.6)" />
                    <Tooltip 
                      contentStyle={{ 
                        backgroundColor: 'rgba(0, 0, 0, 0.8)', 
                        border: '1px solid rgba(255, 255, 255, 0.2)',
                        borderRadius: '8px'
                      }}
                    />
                    <Bar dataKey="accuracy" fill="#00ff88" />
                    <Bar dataKey="efficiency" fill="#ff6b35" />
                    <Bar dataKey="consistency" fill="#ff1744" />
                  </BarChart>
                </ResponsiveContainer>
              </div>
            </div>
          )}

          {activeTab === 'system' && (
            <div className="system-content">
              <div className="system-stats">
                <div className="system-card">
                  <h3>System Health</h3>
                  <div className="health-metrics">
                    <div className="health-item">
                      <span>CPU Usage</span>
                      <div className="progress-bar">
                        <div className="progress-fill" style={{ width: '65%' }}></div>
                      </div>
                      <span>65%</span>
                    </div>
                    <div className="health-item">
                      <span>Memory Usage</span>
                      <div className="progress-bar">
                        <div className="progress-fill" style={{ width: '78%' }}></div>
                      </div>
                      <span>78%</span>
                    </div>
                    <div className="health-item">
                      <span>Storage</span>
                      <div className="progress-bar">
                        <div className="progress-fill" style={{ width: '45%' }}></div>
                      </div>
                      <span>45%</span>
                    </div>
                  </div>
                </div>
                
                <div className="system-card">
                  <h3>Data Processing</h3>
                  <div className="data-stats">
                    <div className="data-item">
                      <Database size={24} />
                      <div>
                        <div className="data-value">{systemStats.dataProcessed} GB</div>
                        <div className="data-label">Processed Today</div>
                      </div>
                    </div>
                    <div className="data-item">
                      <FileText size={24} />
                      <div>
                        <div className="data-value">1,247</div>
                        <div className="data-label">Log Entries</div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          )}
        </motion.div>
      </div>
    </div>
  );
};

export default AdminPanel;
